export const PricingTypes = {
    FIXED: 'fixed',
    CUSTOM: 'custom',
    BIDDING: 'bidding'
};

export const ELECTRICAL_CATEGORIES = [
    'electrical-repair',
    'electrical-installation',
    'electrical-maintenance',
    'electrical-emergency',
    'electrical-inspection'
];

export const ELECTRICAL_VISITING_CHARGE = 299;

export class ServiceBid {
    constructor(providerId, amount, message, timestamp) {
        this.providerId = providerId;
        this.amount = amount;
        this.message = message;
        this.timestamp = timestamp;
    }
}

export class CustomQuoteRequest {
    constructor(userId, serviceId, requirements, preferredDate) {
        this.userId = userId;
        this.serviceId = serviceId;
        this.requirements = requirements;
        this.preferredDate = preferredDate;
        this.status = 'pending';
        this.timestamp = new Date();
    }
}
